import React from 'react'

const Item = ({item}) => {
  return (
    <div className='work__card' key={item.id} >
        
        <a href={item.Doman} className="work__botton">
        <img src={item.image} alt="" className='work__img' />
        </a>

        <div className="work__title"><h3 className="work__title">{item.title}</h3></div>
        
        
    </div>
  )
}

export default Item
